	(1,'电视上','<p></p><p></p><p></p><p></p><p></p><p></p><p><b>的速度是多少</b><img src=\"data:image/png;base64,\" style=\"max-width: 100%;\"></p><p>　　EDG选用出保护能力更强一些的阵容，而Snake是一套进攻阵容。在比赛的前期，双方打得有来有回，Snake上野配合优秀，让本发育不良的大树顺利成长线上压制住了<a href=\"http://lol.duowan.com/gnar/\" target=\"_blank\">纳尔</a>，而下路由于Snake的一波失误，也是让EDG的<a href=\"http://lol.duowan.com/ezreal/\" target=\"_blank\">EZ</a>有着不错的发育，双方基本上处于持平发育阶段。</p><p>　　比赛进入中期，Snake完美发挥了阵容双前排的优势，连续开团帮助队伍两度拿下大龙，取得经济上绝对的领先。 但有着<a href=\"http://lol.duowan.com/azir/\" target=\"_blank\">阿兹尔</a>的EDG防守能力极强，让Snake在有着双龙buff后仍是难以一波结束比赛。</p><p>　　双方陷入僵局直到44分钟，<a href=\"http://lol.duowan.com/khazix/\" target=\"_blank\">螳螂</a>成功勾引到EDG众人前往野区接团，阿兹尔没有输出空间，Snake趁此一波将EDG团灭，首局先下一城！</p><p>　　<strong>【赛后截图】</strong></p><p><img src=\"http://img2.dwstatic.com/lol/1801/379272358909/1515317205566.png\" width=\"650\" height=\"\" alt=\"3比1击败Snake 恭喜EDG再夺德杯冠军\" class=\"\" style=\"max-width:100%;\"></p><p>　　<strong>【MVP】</strong></p><p><br></p><p><img src=\"data:image/png;base64,\" style=\"max-width:100%;\"><br></p><p><img src=\"data:image/png;base64,\" style=\"max-width:100%;\"><br></p><p><img src=\"data:image/png;base64,\" style=\"max-width:100%;\"><br></p><p><br></p><p><img src=\"data:image/png;base64,\" style=\"max-width:100%;\"><br></p><p><br></p>','images/663e723cd826ac9ffe80292c01e8e8e3.jpeg',10,4,'2017-12-28 09:17:46','2018-02-08 02:13:23',NULL,'snake,edg,阿兹尔,发育,阵容',NULL,'www.baidu.com',NULL);
