	(11,'111','<p></p><table data-tab-size=\"8\"><tbody><tr></tr><tr><td id=\"LC6\">动态地给一个对象添加一些额外的职责,</td></tr><tr><td id=\"L7\" data-line-number=\"7\"></td><td id=\"LC7\">就增加功能来说, 装饰模式比生成子类更为灵活</td></tr><tr><td id=\"L8\" data-line-number=\"8\"></td><td id=\"LC8\"></td></tr><tr><td id=\"L9\" data-line-number=\"9\"></td><td id=\"LC9\">- 装饰模式, 是为已有功能动态地添加更多功能的一种方式</td></tr><tr><td id=\"L10\" data-line-number=\"10\"></td><td id=\"LC10\">- 有效地将核心职责和装饰功能区分开</td></tr><tr><td id=\"L11\" data-line-number=\"11\"></td></tr></tbody></table><p><br></p>','',17,NULL,'2018-01-18 03:04:12','2018-01-18 03:04:12',NULL,'tbodydata-line-numbertable装饰子类',NULL,NULL,1),
	(12,'222','<p></p><p>2PhpanAlysis分词系统是基于字符串匹配的分词方法 ，这种方法又叫做机械分词方法，它是按照一定的策略将待分析的汉字串与一个“充分大的”机器词典中的词条进行配，若在词典中找到某个字符串，则匹配成功（识别出一个词）。按照扫描方向的不同，串匹配分词方法可以分为正向匹配 和逆向匹配；按照不同长度优先匹配的情况，可以分为最大（最长）匹配和最小（最短）匹配；按照是否与词性标注过程相结合，又可以分为单纯分词方法和分词与标注相结合的一体化方法。</p>','',18,NULL,'2018-01-18 03:05:40','2018-01-18 03:05:40',NULL,',分词,匹配,方法,字符,词典',NULL,NULL,1),
	(13,'hahahahah','<p></p><div>Lite-DoVerification</div><div><h2 id=\"Lite-DoVerification-URL\">URL</h2><p>&nbsp;GET&nbsp;<a href=\"https://api.megvii.com/faceid/lite/do\" rel=\"nofollow\">https://api.megvii.com/faceid/lite/do</a></p><p><strong>注意：</strong>在生产环境中，请使用<strong>HTTPS</strong>的通信方式。HTTP方式的通信属于不安全链路，存在安全风险，请勿在生产环境中使用。在生产环境中使用HTTP方式的，将无法得到服务可靠性保障</p><h2 id=\"Lite-DoVerification-说明\">说明</h2><p>此接口提供 FaceID Lite 验证服务，通过 GetToken 接口获得 token，可利用此接口转跳到对应的网页验证。</p></div>','',19,NULL,'2018-01-18 03:16:16','2018-01-18 03:16:17',NULL,'nbsp,接口,生产,验证,faceid,',NULL,NULL,1),
	(14,'学习网络会','<p></p><p>Neural Style是一个非常有意思的深度学习应用：输入一张代表内容的图片和一张代表风格的图片，深度学习网络会输出一张融合了这个风格和内容的新作品。TensorFlow是Google开源的最流行的深度学习框架。作者anishathalye使用TensorFlow实现了Neural Style，并将其开源放在了GitHub上。本文对他的代码进行深入剖析。<br></p>','',20,NULL,'2018-01-18 03:25:37','2018-01-18 03:25:38',NULL,'style,开源,neural,tensorflow,深度学习,',NULL,NULL,1),
	(15,'asdssda','<p></p><p>本节课结束后，你能学习到：</p><ul><li>用一个<code>Docker Compose</code>文件管理多个<code>git</code>仓库的服务</li><li>在容器中运行单元测试和集成测试</li><li>每个服务不依赖<code>Docker</code>运行</li><li>为集成测试配置<code>Travis CI</code></li><li>在容器中运行<code>React</code>应用</li><li>用<code>React</code>组件构建一个单页面应用</li></ul>','',21,NULL,'2018-01-18 03:30:07','2018-01-18 03:30:07',NULL,'运行,测试,容器,docker,react,',NULL,NULL,1),
	(16,'1','<p></p><p>Neural Style是一个非常有意思的深度学习应用：输入一张代表内容的图片和一张代表风格的图片，深度学习网络会输出一张融合了这个风格和内容的新作品。TensorFlow是Google开源的最流行的深度学习框架。作者anishathalye使用TensorFlow实现了Neural Style，并将其开源放在了GitHub上。本文对他的代码进行深入剖析。<br></p>','',22,NULL,'2018-01-18 03:33:15','2018-01-18 03:33:15',NULL,'深度学习,tensorflow,neural,开源,style',NULL,NULL,1),
